import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, Image, FlatList } from 'react-native';
import { useNavigate } from 'react-router-dom';
import arrow from "./AlwaysActive/images/arrow.png";
import { personList, exponateList } from '../Application/Classes/testDataGenerator';

const persons = personList;
const exponate = exponateList;

const Home = ({ darkMode }) => { // Dark Mode als Prop empfangen
    const [hoveredIndex, setHoveredIndex] = useState(null);
    const navigate = useNavigate();

    const handleNavigation = (route) => {
        navigate(route);
    };

    const handleHover = (index) => {
        setHoveredIndex(index);
    };

    const renderPerson = ({ item, index }) => (
        <View
            style={{ width: 400, flexDirection: "row" }}
            key={index}
            onMouseEnter={() => handleHover(index)}
            onMouseLeave={() => handleHover(null)}
        >
            <View style={[stylesTexts.simpleListItem, darkMode && stylesTexts.simpleListItemDark]}>
                <View style={{ flexDirection: "row", width: 400 }}>
                    <Text style={[stylesTexts.listText, darkMode && stylesTexts.listTextDark]}>
                        {item.nachname}
                    </Text>
                    <Text> </Text>
                    <Text style={[stylesTexts.listText, darkMode && stylesTexts.listTextDark]}>
                        {item.vorname}
                    </Text>
                </View>
            </View>
        </View>
    );

    const renderExpon = ({ item, index }) => (
        <View
            style={{ width: 400, flexDirection: "row" }}
            key={index}
            onMouseEnter={() => handleHover(index)}
            onMouseLeave={() => handleHover(null)}
        >
            <View style={[stylesTexts.simpleListItem, darkMode && stylesTexts.simpleListItemDark]}>
                <View style={{ flexDirection: "row", width: 1000 }}>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode && stylesTexts.listTextDark]}>
                        {item.exponatId}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 180 }, darkMode && stylesTexts.listTextDark]}>
                        {item.titel}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode && stylesTexts.listTextDark]}>
                        {item.kategorie}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode && stylesTexts.listTextDark]}>
                        {item.masse}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 100 }, darkMode && stylesTexts.listTextDark]}>
                        {item.gewicht}
                    </Text>
                    <Text style={[stylesTexts.listText, { width: 300 }, darkMode && stylesTexts.listTextDark]}>
                        {item.kommentar}
                    </Text>
                </View>
            </View>
        </View>
    );

    return (
        <View style={[stylesContainers.container, darkMode && stylesContainers.containerDark]}>
            <View style={stylesContainers.welcomeView}>
                <Text style={[stylesTexts.welcomeText, darkMode && stylesTexts.welcomeTextDark]}>Willkommen!</Text>
            </View>
            <View style={stylesContainers.diffcont}>
                {/* Exponate Section */}
                <View style={[stylesContainers.viewList, darkMode && stylesContainers.viewListDark]}>
                    <View>
                        <View style={stylesContainers.headerRow}>
                            <Text style={[stylesTexts.titleOfLists, darkMode && stylesTexts.titleOfListsDark]}>Exponate</Text>
                            <TouchableOpacity onPress={() => handleNavigation("/exponate")}>
                                <Image style={stylesTexts.images} source={arrow} />
                            </TouchableOpacity>
                        </View>
                    </View>
                    <FlatList
                        data={exponate}
                        renderItem={renderExpon}
                        keyExtractor={(item, index) => index.toString()}
                    />
                </View>

                {/* Personen Section */}
                <View style={[stylesContainers.viewList, stylesContainers.personList, darkMode && stylesContainers.viewListDark]}>
                    <View>
                        <View style={stylesContainers.headerRow}>
                            <Text style={[stylesTexts.titleOfLists, darkMode && stylesTexts.titleOfListsDark]}>Personen</Text>
                            <TouchableOpacity onPress={() => handleNavigation("/persons")}>
                                <Image style={stylesTexts.images} source={arrow} />
                            </TouchableOpacity>
                        </View>
                    </View>
                    <FlatList
                        data={persons}
                        renderItem={renderPerson}
                        keyExtractor={(item, index) => index.toString()}
                    />
                </View>
            </View>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        width: 1350,
        paddingLeft: 20,
        backgroundColor: '#fff',
    },
    containerDark: {
        backgroundColor: 'rgb(18,18,18)',
    },
    diffcont: {
        flexDirection: "row",
        padding: 20
    },
    viewList: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        padding: 10,
        height: 300,
        width: 600,
        margin: 10,
        backgroundColor: '#f9f9f9',
    },
    viewListDark: {
        backgroundColor: 'rgb(34,34,34)',
        borderColor: 'rgb(85,129,176)',
    },
    personList: {
        width: 300,
    },
    headerRow: {
        flexDirection: "row",
        justifyContent: "space-between",
        marginBottom: 10,
    }
});

const stylesTexts = StyleSheet.create({
    welcomeText: {
        color: 'rgba(240,175,77,1)',
        fontWeight: "bold",
        fontSize: 50,
    },
    welcomeTextDark: {
        color: 'white',
    },
    titleOfLists: {
        color: 'rgba(141,69,85,1)',
        fontWeight: "bold",
        fontSize: 17
    },
    titleOfListsDark: {
        color: 'rgb(85,129,176)',
    },
    listText: {
        fontSize: 12,
        color: 'rgba(33,33,33,1)',
    },
    listTextDark: {
        color: 'white',
    },
    images: {
        width: 20,
        height: 20,
    },
    simpleListItem: {
        flexDirection: "row",
        paddingVertical: 5,
        borderBottomWidth: 1,
        borderBottomColor: '#ddd',
    },
    simpleListItemDark: {
        borderBottomColor: 'rgb(85,129,176)',
    },
});

export default Home;
